    static ProvinceMesh* Taiwan();
    static ProvinceMesh* ShangHai();
    static ProvinceMesh* TianJing();
    
    ::juice::cocoa::Path path;
    
    void prepare(::wsi::juice::Driver* drv, ::juice::renderinfo* info)
    {
        drv->get_context()->reverse();
    }
    
    void render(::wsi::juice::Driver* drv, ::juice::renderinfo* info)
    {
        ::wsi::juice::Driver::context_type ctx = drv->get_context();
        path.stroke(*ctx, ::juice::cocoa::Pen(::juice::cocoa::Color(0.f, 1.f, 1.f), 1));
        path.fill(*ctx, ::juice::cocoa::Brush(::juice::cocoa::Color(1.f, 1.f, 1.f)));        
    }
    
    bool contain(CGPoint const& pt) const
    {
        return path.contain(pt);
    }
    
};

