class UIChinaMapScreenManager
: public ::wsi::juice::ScreenManager<UIChinaMapScreenManager>
{
    typedef ::wsi::juice::ScreenManager<UIChinaMapScreenManager> super;
    
public:
    
    void begin_frame()
    {
        //camera.see(this->_painter());
    }
    
    void next_frame()
    {
        tree.render(this->_painter(), &tree, &this->_renderinfo);
    }
      
    ::wsi::juice::Camera camera;
    ProvincesTree tree;
    
};

@interface UIChinaMapView : NNTUIView {
    UIChinaMapScreenManager _screenManager;
}

- (void)render;

@end

@implementation UIChinaMapView

- (id)initWithZero {
    self = [super initWithZero];

    _screenManager.set_drawable(self);
    [self connect:kSignalViewClicked sel:@selector(act_clicked:) obj:self];
    
    return self;
}

- (void)setFrame:(CGRect)frame {
    [super setFrame:frame];
    
    ::wsi::juice::Types::viewport_type vp;
    vp.origin.x = vp.origin.y = 0;
    vp.size.w = frame.size.width;
    vp.size.h = frame.size.height;
    _screenManager.camera.set_viewport(vp);
}

- (void)drawRect:(CGRect)rect {
    _screenManager.update();
    _screenManager.flush();
}

- (void)render {
    _screenManager.resume();
}

- (void)act_clicked:(NNTEventObj*)evt {
    NSSet* touches = (NSSet*)evt.result;
    CGPoint pt = [[touches anyObject] locationInView:self];
    ProvincesTree::entities_type::const_iterator each = _screenManager.tree.entities.begin();
    while (each != _screenManager.tree.entities.end())
    {
        ProvinceMesh const* mesh = (ProvinceMesh const*)each->object;
        if (mesh->contain(pt))
        {
            [Msgbox info: ::wsi::tostr(mesh->identity)];
            break;
        }
        ++each;
    }
}

@end

@implementation UIChinaMapController

- (void)loadView {
    UIChinaMapView* view = [[UIChinaMapView alloc] initWithZero];
    self.view = view;
    [view release];
}

- (void)viewIsLoading{
    UIChinaMapView* view = (UIChinaMapView*)self.view;
    [view render];
}

@end

